import React, { Component } from 'react';

class HomepageBox extends Component {
    render() { 
        return (
        <div>
            <h1> everyone can be an alcoholic but not everyone can be well read</h1>
            <div class="container">
                <div class="row">
                    <div class="col-sm homepage-button">
                        join a party
                    </div>
                    <div class="homepage-button">
                        create a party
                    </div>
                </div>
            </div>
        </div>
        )
    }
}

export default HomepageBox;
